
const interFontURL = `data:font/woff2;base64,`;

const interFontDecStr = `
@font-face {
  font-family: 'Inter';
  font-style: normal;
  font-weight: 600;
  font-display: swap;
  src: url(${interFontURL}) format('woff2');
}
`;

export const interFontDec = 'data:text/css;base64,' + btoa(interFontDecStr);
